"use client";

import {useEffect, useState} from "react";
import Link from "next/link";
import Navigation from "@/components/Navbar/Navigation";

export default function Navbar() {

    const [isMobileMenuOpen, setMobileMenuOpen] = useState(false);
    const [scrolled, setScrolled] = useState(false);

    const toggleMobileMenu = () => {
        setMobileMenuOpen(!isMobileMenuOpen);
    };

    useEffect(() => {
        const handleScroll = () => {
            const isScrolled = window.scrollY > 0;
            setScrolled(isScrolled);
        };

        window.addEventListener('scroll', handleScroll);

        return () => {
            window.removeEventListener('scroll', handleScroll);
        };
    }, []);

    return (
        <nav
            className={`p-4 lg:pl-32 lg:pr-32 text-black font-semibold fixed w-full transition-all ${
                scrolled ? 'bg-white shadow-lg' : 'bg-transparent'
            }`}
            style={{zIndex: 100}}
        >
            <div
                className={`container mx-auto flex justify-between items-center ${
                    isMobileMenuOpen ? "flex-col items-center" : "pl-0"
                }`}
            >
                <div
                    className={`text-center ${isMobileMenuOpen ? "w-full" : "w-auto"} ${
                        isMobileMenuOpen ? "mx-auto" : ""
                    }`}
                ></div>
                <div className="hidden md:block text-lg w-full">
                    <div className="flex items-center justify-between">
                        {/* Logo on the left */}
                        <div className="flex items-center">
                            {/* SLIIT CSNE Logo */}
                            <Link href="/">
                                <svg width={155} height={96} viewBox="0 0 155 96" fill="none"
                                     xmlns="http://www.w3.org/2000/svg"
                                     xmlnsXlink="http://www.w3.org/1999/xlink">
                                    <rect width="154.613" height={96} fill="url(#pattern0)"/>
                                    <defs>
                                        <pattern id="pattern0" patternContentUnits="objectBoundingBox" width={1}
                                                 height={1}>
                                            <use xlinkHref="#image0_659_107"
                                                 transform="matrix(0.000925926 0 0 0.00149125 0 -0.305275)"/>
                                        </pattern>
                                        <image id="image0_659_107" width={1080} height={1080}
                                               xlinkHref="data:image/jpeg;base64,"/>
                                    </defs>
                                </svg>
                            </Link>
                        </div>

                        {/* Navigation items on the right */}
                        <Navigation/>
                    </div>
                </div>
                <div className="md:hidden flex items-center">
                    <button
                        className="animate-bounce text-black"
                        onClick={toggleMobileMenu}
                    >
                        &#9776;
                    </button>
                </div>
            </div>
            <ul
                className={`md:hidden ${
                    isMobileMenuOpen ? "block" : "hidden"
                } border-t border-black`}
            >
                <div className="flex flex-col items-center">
                    <li>
                        <a href="/">Home</a>
                    </li>
                    <li>
                        <a href="/about">About</a>
                    </li>
                    <li>
                        <a href="/events">Events</a>
                    </li>
                    <li>
                        <a href="/board">Board</a>
                    </li>
                    <li>
                        <a href="/stories">Stories</a>
                    </li>
                    <li>
                        <a href="/contactUs">Contact Us</a>
                    </li>
                </div>
            </ul>
        </nav>
    );
}
